css:
.nuclide-ui-unstyled-button.nuclide-ui-unstyled-button {
  -webkit-appearance: none;
  background: none;
  border: 0;
  padding: 0;
  cursor: pointer;
  text-align: inherit;
  height: inherit;
}
.nuclide-ui-unstyled-button.nuclide-ui-unstyled-button:active,
.nuclide-ui-unstyled-button.nuclide-ui-unstyled-button:hover {
  background: none;
}
